import React, { useRef } from "react";
import Sidebar from "./Sidebar";
import MainSection from "./MainSection";
import "../App.css";
import { motion } from "framer-motion";

function Home() {

    const parentRef = useRef(null);

  return (
    <div ref={parentRef} className="sectionone ">
      <div className="">
        <div className="row gap-0">
          <motion.div
           drag
           dragConstraints={parentRef}
            className="col-12 col-xl-3 "
          >
            <div className="container">
              <div className=" sidebar my-3 my-xl-4">
                <Sidebar />
              </div>
            </div>
          </motion.div>
          <motion.div

            className="col-12 col-xl-9 "
          >
            <div className="container">
              <div className=" secOneChildOne my-3 my-xl-4">
                <div className=" mainsection has-scrollbar ">
                  <div className="">
                    <MainSection />
                  </div>
                </div>
              </div>
            </div>
          </motion.div>
        </div>
      </div>
    </div>
  );
}

export default Home;
